// src/pages/Blog.tsx
import React from 'react';

const Blog: React.FC = () => {
  return (
    <div className="bg-gray-100 min-h-screen p-8">
      <h1 className="text-3xl font-bold mb-8">Blog</h1>
      <h1>About Page</h1>
    </div>
  );
};

export default Blog;
